import React, { useState, useEffect } from 'react';
import {
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
  Area,
  ComposedChart,
  Line
} from 'recharts';
import './DeadlockChart.css';

const DeadlockChart = () => {
  const [data, setData] = useState([]);
  const [isRealTime, setIsRealTime] = useState(true);
  const [isLoading, setIsLoading] = useState(true);

  // Generate initial data
  const generateInitialData = () => {
    const initialData = [];
    const now = new Date();
    
    for (let i = 23; i >= 0; i--) {
      const time = new Date(now.getTime() - i * 60000); // Every minute
      initialData.push({
        time: time.toLocaleTimeString('en-US', { hour12: false, hour: '2-digit', minute: '2-digit' }),
        timestamp: time.getTime(),
        conflicts: Math.floor(Math.random() * 8) + 1,
        resolved: Math.floor(Math.random() * 6) + 2,
        partial: Math.floor(Math.random() * 3),
        totalDeadlocks: Math.floor(Math.random() * 5) + 1
      });
    }
    return initialData;
  };

  useEffect(() => {
    // Add a small delay to ensure proper initialization
    const timer = setTimeout(() => {
      setData(generateInitialData());
      setIsLoading(false);
    }, 100);
    
    return () => clearTimeout(timer);
  }, []);

  // Real-time data updates
  useEffect(() => {
    if (!isRealTime || isLoading) return;

    const interval = setInterval(() => {
      setData(prevData => {
        if (!prevData || prevData.length === 0) {
          return generateInitialData();
        }
        
        const newData = [...prevData];
        const now = new Date();
        
        // Add new data point
        newData.push({
          time: now.toLocaleTimeString('en-US', { hour12: false, hour: '2-digit', minute: '2-digit' }),
          timestamp: now.getTime(),
          conflicts: Math.floor(Math.random() * 8) + 1,
          resolved: Math.floor(Math.random() * 6) + 2,
          partial: Math.floor(Math.random() * 3),
          totalDeadlocks: Math.floor(Math.random() * 5) + 1
        });
        
        // Keep only last 24 points
        if (newData.length > 24) {
          newData.shift();
        }
        
        return newData;
      });
    }, 5000); // Update every 5 seconds

    return () => clearInterval(interval);
  }, [isRealTime, isLoading]);

  const CustomTooltip = ({ active, payload, label }) => {
    if (active && payload && payload.length) {
      return (
        <div className="custom-tooltip">
          <p className="tooltip-label">{`Time: ${label}`}</p>
          {payload.map((entry, index) => (
            <p key={index} className="tooltip-item" style={{ color: entry.color }}>
              {`${entry.name}: ${entry.value}`}
            </p>
          ))}
        </div>
      );
    }
    return null;
  };

  // Show loading state while data is being initialized
  if (isLoading || !data || data.length === 0) {
    return (
      <div className="dashboard-panel chart-panel">
        <div className="chart-header">
          <h2>Deadlock Resolution Logs</h2>
        </div>
        <div className="chart-container">
          <div className="loading-state">
            <p>Loading chart data...</p>
          </div>
        </div>
      </div>
    );
  }

  // Get current values safely
  const currentData = data[data.length - 1] || {};
  const currentConflicts = currentData.conflicts || 0;
  const currentResolved = currentData.resolved || 0;
  const currentDeadlocks = currentData.totalDeadlocks || 0;

  return (
    <div className="dashboard-panel chart-panel">
      <div className="chart-header">
        <h2>Deadlock Resolution Logs</h2>
        <div className="chart-controls">
          <button 
            className={`control-btn ${isRealTime ? 'active' : ''}`}
            onClick={() => setIsRealTime(!isRealTime)}
          >
            {isRealTime ? 'Pause' : 'Resume'} Real-time
          </button>
          <button 
            className="control-btn"
            onClick={() => {
              setIsLoading(true);
              setTimeout(() => {
                setData(generateInitialData());
                setIsLoading(false);
              }, 100);
            }}
          >
            Reset Data
          </button>
        </div>
      </div>
      
      <div className="chart-container">
        <ResponsiveContainer width="100%" height={300}>
          <ComposedChart data={data} margin={{ top: 10, right: 30, left: 0, bottom: 0 }}>
            <defs>
              <linearGradient id="conflictsGradient" x1="0" y1="0" x2="0" y2="1">
                <stop offset="5%" stopColor="#e74c3c" stopOpacity={0.8}/>
                <stop offset="95%" stopColor="#e74c3c" stopOpacity={0.1}/>
              </linearGradient>
              <linearGradient id="resolvedGradient" x1="0" y1="0" x2="0" y2="1">
                <stop offset="5%" stopColor="#2ecc71" stopOpacity={0.8}/>
                <stop offset="95%" stopColor="#2ecc71" stopOpacity={0.1}/>
              </linearGradient>
              <linearGradient id="partialGradient" x1="0" y1="0" x2="0" y2="1">
                <stop offset="5%" stopColor="#f39c12" stopOpacity={0.8}/>
                <stop offset="95%" stopColor="#f39c12" stopOpacity={0.1}/>
              </linearGradient>
            </defs>
            <CartesianGrid strokeDasharray="3 3" stroke="rgba(255,255,255,0.1)" />
            <XAxis 
              dataKey="time" 
              stroke="#8884d8"
              fontSize={12}
              tick={{ fill: 'var(--text-secondary)' }}
            />
            <YAxis 
              stroke="#8884d8"
              fontSize={12}
              tick={{ fill: 'var(--text-secondary)' }}
            />
            <Tooltip content={<CustomTooltip />} />
            <Legend 
              wrapperStyle={{ color: 'var(--text-primary)' }}
            />
            
            <Area
              type="monotone"
              dataKey="conflicts"
              stackId="1"
              stroke="#e74c3c"
              fill="url(#conflictsGradient)"
              name="Resource Conflicts"
              strokeWidth={2}
            />
            <Area
              type="monotone"
              dataKey="resolved"
              stackId="1"
              stroke="#2ecc71"
              fill="url(#resolvedGradient)"
              name="Successful Resolution"
              strokeWidth={2}
            />
            <Area
              type="monotone"
              dataKey="partial"
              stackId="1"
              stroke="#f39c12"
              fill="url(#partialGradient)"
              name="Partial Resolution"
              strokeWidth={2}
            />
            
            <Line
              type="monotone"
              dataKey="totalDeadlocks"
              stroke="#9b59b6"
              strokeWidth={3}
              dot={{ fill: '#9b59b6', strokeWidth: 2, r: 4 }}
              name="Total Deadlocks"
              strokeDasharray="5 5"
            />
          </ComposedChart>
        </ResponsiveContainer>
      </div>
      
      <div className="chart-stats">
        <div className="stat-item">
          <span className="stat-label">Current Conflicts</span>
          <span className="stat-value conflicts">{currentConflicts}</span>
        </div>
        <div className="stat-item">
          <span className="stat-label">Resolved</span>
          <span className="stat-value resolved">{currentResolved}</span>
        </div>
        <div className="stat-item">
          <span className="stat-label">Active Deadlocks</span>
          <span className="stat-value deadlocks">{currentDeadlocks}</span>
        </div>
      </div>
    </div>
  );
};

export default DeadlockChart;
